package kr.happyjob.study.jmg.model;

import java.util.Date;

public class ResumeClassInfoDto {
	
	private int class_No;
	private String class_Nm;
	private String loginID;
	private Date class_Startdate;
	private Date class_Enddate;
	private String class_Type;
	private String name;
	private int class_Cnt;
	private int class_Totalcnt;
	private int score;
	private String q_Type;
	private String state;
	public ResumeClassInfoDto() {
		super();
		// TODO Auto-generated constructor stub
	}
	public ResumeClassInfoDto(int class_No, String class_Nm, String loginID, Date class_Startdate, Date class_Enddate,
			String class_Type, String name, int class_Cnt, int class_Totalcnt, int score, String q_Type, String state) {
		super();
		this.class_No = class_No;
		this.class_Nm = class_Nm;
		this.loginID = loginID;
		this.class_Startdate = class_Startdate;
		this.class_Enddate = class_Enddate;
		this.class_Type = class_Type;
		this.name = name;
		this.class_Cnt = class_Cnt;
		this.class_Totalcnt = class_Totalcnt;
		this.score = score;
		this.q_Type = q_Type;
		this.state = state;
	}
	public int getClass_No() {
		return class_No;
	}
	public void setClass_No(int class_No) {
		this.class_No = class_No;
	}
	public String getClass_Nm() {
		return class_Nm;
	}
	public void setClass_Nm(String class_Nm) {
		this.class_Nm = class_Nm;
	}
	public String getLoginID() {
		return loginID;
	}
	public void setLoginID(String loginID) {
		this.loginID = loginID;
	}
	public Date getClass_Startdate() {
		return class_Startdate;
	}
	public void setClass_Startdate(Date class_Startdate) {
		this.class_Startdate = class_Startdate;
	}
	public Date getClass_Enddate() {
		return class_Enddate;
	}
	public void setClass_Enddate(Date class_Enddate) {
		this.class_Enddate = class_Enddate;
	}
	public String getClass_Type() {
		return class_Type;
	}
	public void setClass_Type(String class_Type) {
		this.class_Type = class_Type;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public int getClass_Cnt() {
		return class_Cnt;
	}
	public void setClass_Cnt(int class_Cnt) {
		this.class_Cnt = class_Cnt;
	}
	public int getClass_Totalcnt() {
		return class_Totalcnt;
	}
	public void setClass_Totalcnt(int class_Totalcnt) {
		this.class_Totalcnt = class_Totalcnt;
	}
	public int getScore() {
		return score;
	}
	public void setScore(int score) {
		this.score = score;
	}
	public String getQ_Type() {
		return q_Type;
	}
	public void setQ_Type(String q_Type) {
		this.q_Type = q_Type;
	}
	public String getState() {
		return state;
	}
	public void setState(String state) {
		this.state = state;
	}
	@Override
	public String toString() {
		return "ResumeClassInfoDto [class_No=" + class_No + ", class_Nm=" + class_Nm + ", loginID=" + loginID
				+ ", class_Startdate=" + class_Startdate + ", class_Enddate=" + class_Enddate + ", class_Type="
				+ class_Type + ", name=" + name + ", class_Cnt=" + class_Cnt + ", class_Totalcnt=" + class_Totalcnt
				+ ", score=" + score + ", q_Type=" + q_Type + ", state=" + state + "]";
	}
	

}
